window.bookSummaryJSON = "<p><b>The president’s daughter...</b></p> <p><b>The women determined to save her...</b></p> <p><b>The man with the power to betray a nation...</b></p> <p>Melissa Riley arrives at her sister’s isolated Virginia country home to find herself plunged into a deadly drama. There, the renowned Dr. Jessica Riley is attempting to draw the daughter of the president of the United States out of a severe catatonic trauma. The last thing young Cassie Andreas saw was an organized team ruthlessly murder her nanny and the Secret Service agents sworn to protect her. But to free Cassie, Melissa and Jessica must trust a mysterious, charismatic man.</p> <p>Michael Travis made his fortune in the international underworld. He risked everything to save Cassie during that terrible night of bloodshed. And he has entered into a secret bargain with the president. But is his show of concern all a treacherous charade? Melissa and Jessica have no choice but to accept Travis as their ally - and to follow a dangerous plan that will lead them into the world of a killer who’ll destroy anyone standing between him and the...<b>Final Target</b>.</p>"; 
